INSERT INTO `system_mail_partials` (`id`, `name`, `code`, `content_html`, `content_text`, `is_custom`, `created_at`, `updated_at`) VALUES
	(1, 'Header', 'header', '<tr>\r\n    <td class="header">\r\n        {% if url %}\r\n            <a href="{{ url }}">\r\n                {{ body }}\r\n            </a>\r\n        {% else %}\r\n            <span>\r\n                {{ body }}\r\n            </span>\r\n        {% endif %}\r\n    </td>\r\n</tr>', '*** {{ body|trim }} <{{ url }}>', 0, '2020-10-10 21:02:27', '2020-10-10 21:02:27'),
	(2, 'Footer', 'footer', '<tr>\r\n    <td>\r\n        <table class="footer" align="center" width="570" cellpadding="0" cellspacing="0">\r\n            <tr>\r\n                <td class="content-cell" align="center">\r\n                    {{ body|md_safe }}\r\n                </td>\r\n            </tr>\r\n        </table>\r\n    </td>\r\n</tr>', '-------------------\r\n{{ body|trim }}', 0, '2020-10-10 21:02:27', '2020-10-10 21:02:27'),
